import React from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';


const Footer=()=>{
	return (
		<div>
			<Paper>
				<Tabs
					indicatorColor="primary"
					textColor="primary"
					centered>

					<Tab label="Item 1" />
					<Tab label="Item 2" />
					<Tab label="Item 3" />
				</Tabs>
			</Paper>
		</div>
		)
}

export default Footer;
